	/*
	 * 构造hashtable，键值关系为s与t中对位元素的对应关系，即s中的元素是sTable的健，tTable的值
	 */
	public static boolean isIsormophic(String s, String t) {
		if (s == null && t == null || s.length() == 0 && t.length() == 0)
			return true;
		int[] st = new int[256];
		int[] ts = new int[256];
		for (int i = 0; i < 256; i++) {
			st[i] = 300;
			ts[i] = 300;
		}
		for (int i = 0; i < s.length(); i++) {
			int sc = s.charAt(i);
			int tc = t.charAt(i);
			if (st[sc] == 300) {
				if (ts[tc] == 300) {
					st[sc] = tc;
					ts[tc] = sc;
				} else {
					return false;
				}
			} else {
				if (st[sc] != tc || ts[tc] != sc)
					return false;

			}
		}
		return true;
	}

	// 这个方法每次存贮的是上一个对应元素的位置，在判断第129个元素的时候出现了问题！！
	// 集合中的泛型类型不能是基本类型，对于基本类型要使用包装类，在比较的时候应该用equals方法！！！！！
	public static boolean isIsormophic1(String s, String t) {
		if (s == null && t == null || s.length() == 0 && t.length() == 0)
			return true;
		Map<Integer, Integer> sTable = new HashMap<Integer, Integer>(256);
		Map<Integer, Integer> tTable = new HashMap<Integer, Integer>(256);
		for (int i = 0; i < s.length(); i++) {
			// if(sTable.put(s.charAt(i), i) != tTable.put(t.charAt(i), i))
			// return false;
			int sc = s.charAt(i);
			int tc = t.charAt(i);
			if (sTable.containsKey(sc) && tTable.containsKey(tc)) {
				// 这里get方法返回的是Integer类型的对象，比较的时候应该用equals方法！！！
				// “ == ”比较的是是否具有相同的地址,即具有相同的引用！
				// if(sTable.get(sc). == tTable.get(tc)){
				if (sTable.get(sc).equals(tTable.get(tc))) {
					sTable.put(sc, i);
					tTable.put(tc, i);
				} else {
					return false;
				}
			} else if (!sTable.containsKey(sc) && !tTable.containsKey(tc)) {
				sTable.put(sc, i);
				tTable.put(tc, i);
			} else
				return false;
		}
		return true;
	}

